import React from 'react';




function ChatCard(props) {
    return (
        <div >
            <p>{props.answer.text}</p>
            <div>
            <p>{props.answer.name}</p>
            <p>{props.answer.date}</p>
            </div>

            <img src={props.answer.image} alt=""/>
        </div>
    )
}

export default ChatCard;
